import React from "react";
import "./Worked.css"
import { Tab,
         Tabs,
         TabList,
         TabPanel } from "react-tabs";
// import "react-tabs/style/react-tabs.css";

const CustomTab = ({ children, ...otherProps }) => (
    <Tab {...otherProps}>
        <h1>{children}</h1>
        <p>some test</p>
    </Tab>
);

CustomTab.tabsRole = "Tab";

const Worked: React.FC = () => {
    return (
        <div>
            <Tabs>
                <TabList>
                    <Tab className="custom_tab">Atlas Scientific</Tab>
                    <Tab>Pocket Racers</Tab>
                    <Tab>Juni Learning</Tab>
                </TabList>

                {/* atlas scientific */}
                <TabPanel>
                    <h2>atlas scientific</h2>
                </TabPanel>

                {/* pocket racers */}
                <TabPanel>
                    <h2>pocket racers</h2>
                </TabPanel>

                {/* juni learning */}
                <TabPanel>
                    <h2>juni learning</h2>
                </TabPanel>                
            </Tabs>
        </div>
    );
};

export default Worked;
